You may be missing a Resources class for your package due to your proguard configuration, or you may be using an applicationId in your build that isn't the same as the package declared in your AndroidManifest.xml file.
If you're using proguard, you can fix this issue by adding the following to your proguard configuration:

-keep class **.R$* {
    <fields>;
}

If you're not using proguard, or if your proguard configuration already contains the directive above, you can add the following to your AndroidManifest.xml file to explicitly point the Mixpanel library to the appropriate library for your resources class:

<meta-data android:name=\

uniform mat4 uTexMatrix;
attribute vec4 aPosition;
attribute vec4 aTextureCoord;
varying vec2 %s;
void main() {
    gl_Position = aPosition;
    %s = (uTexMatrix * aTextureCoord).xy;
}

varying vec2 interp_tc_y;
varying vec2 interp_tc_u;
varying vec2 interp_tc_v;
attribute vec4 in_pos;
attribute vec2 in_tc_y;
attribute vec2 in_tc_u;
attribute vec2 in_tc_v;
void main() {
  gl_Position = in_pos;
  interp_tc_y = in_tc_y;
  interp_tc_u = in_tc_u;
  interp_tc_v = in_tc_v;
}

uniform mat4 uMvpMatrix;
uniform mat3 uTexMatrix;
attribute vec4 aPosition;
attribute vec2 aTexCoords;
varying vec2 vTexCoords;
// Standard transformation.
void main() {
  gl_Position = uMvpMatrix * aPosition;
  vTexCoords = (uTexMatrix * vec3(aTexCoords, 1)).xy;
}

uniform mat4 uMVPMatrix;
uniform mat4 uSTMatrix;
attribute vec4 aPosition;
attribute vec4 aTextureCoord;
varying vec2 vTextureCoord;
void main() {
  gl_Position = uMVPMatrix * aPosition;
  vTextureCoord = (uSTMatrix * aTextureCoord).xy;
}

precision mediump float;
varying vec2 interp_tc_y;
varying vec2 interp_tc_u;
varying vec2 interp_tc_v;
uniform sampler2D y_tex;
uniform sampler2D u_tex;
uniform sampler2D v_tex;
uniform mat3 mColorConversion;
void main() {
  vec3 yuv;
  yuv.x = texture2D(y_tex, interp_tc_y).r - 0.0625;
  yuv.y = texture2D(u_tex, interp_tc_u).r - 0.5;
  yuv.z = texture2D(v_tex, interp_tc_v).r - 0.5;
  gl_FragColor = vec4(mColorConversion * yuv, 1.0);
}
